    function init() {

      // Set main canvas and context references
      canvas = document.getElementById("canvas");
      ctx = canvas.getContext("2d");

      // Initialize animations
      sky.alphaClock = new clock(1.00, 0.00, 1, false, 1, linear, 1.0, 1.00, 0.0000);
      grass.alphaClock = new clock(4.00, 0.00, 1, false, 1, linear, 1.0, 1.00, 0.0000);
      text.rotateClock = new clock(9.00, 0.00, -1, false, 1, quadEaseOut, 2.0 * Math.PI, 1.00, 0.0000);
      text.alphaClock = new clock(8.00, 4.50, 1, false, 1, linear, 1.0, 1.00, 0.0000);

      // Play "gobble"  turkey sound when text appears
      text.rotateClock.started.subscribe(playSound);

        // Start animation clocks
      sky.alphaClock.start();
      animations[0].pathClock.start();
      animations[1].pathClock.start();
      animations[2].pathClock.start();
      animations[3].pathClock.start();
      animations[4].pathClock.start();
      animations[5].pathClock.start();
      animations[6].pathClock.start();
      animations[7].pathClock.start();
      grass.alphaClock.start();
      animations[8].pathClock.start();
      text.rotateClock.start();
      text.alphaClock.start();

      // Set animation timer
      setInterval(drawFrame, (1000 / fps));
    }
      // Play turkey "Gobble" when triggered
    function playSound() {

        var gobble = document.getElementById("gobble");
            gobble.play();
    }

    function updateAnimations() {

      // Update animation clocks
      updateAllClocks();

      // Update animation paths  
      var animationCount = animations.length;
      for (var i = 0; i < animationCount; i++) {
        animations[i].update();
      }
    }

    function drawFrame() {

      // Update animations
      updateAnimations();

      // Clear canvas
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      ctx.save();
      ctx.globalAlpha = sky.alphaClock.value;
      sky(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[0].x, animations[0].y);
      greyCloud2(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[1].x, animations[1].y);
      whiteCloud2(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[2].x, animations[2].y);
      greyCloud1(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[3].x, animations[3].y);
      whiteCloud1(ctx);
      ctx.restore();

      ctx.save();

      whiteCloud3(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[5].x, animations[5].y);
      greyCloud3(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[6].x, animations[6].y);
      leaves(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[7].x, animations[7].y);
      pumpkin(ctx);
      ctx.restore();

      ctx.save();
      ctx.globalAlpha = grass.alphaClock.value;
      grass(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(animations[8].x, animations[8].y);
      turkey(ctx);
      ctx.restore();

      ctx.save();
      ctx.translate(497.0, 848.6);
      ctx.rotate(text.rotateClock.value);
      ctx.globalAlpha = text.alphaClock.value;
      text(ctx);
      ctx.restore();
    }
